import React from "react";
import { BrowserRouter, Routes, Route, Link } from "react-router-dom";
import AddNewUser from "./AddNewUser";
import GetUser from "./GetUser";

function App() {
  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route path="/add_user" element={<AddNewUser />}></Route>
        </Routes>
      </BrowserRouter>

      <br />
      <GetUser />
      <h1>Welcome</h1>
    </>
  );
}

export default App;
